<p>L'analyse effectue ici et servant de  base aux "matchs" prsents sur ce site se concentre sur 10 indicateurs jugs essentiels par Eurostat pour 
valuer la situation d'un pays en terme de dveloppement durable.<BR>
Les donnes source sont disponibles en tlchargement sur ce <a href="./data_src/Defi2_IndicCle_Eurostat.xlsx" target="_blank">site</A>, et 
sur le site d'<a href="http://ec.europa.eu/eurostat/web/sdi/indicators" target="_blank">Eurostat</A>.
</p>
